                       The Trail of the Serpent - 2010kaiser
                       ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


An account of investigations into various individual secret societies, their occult practices, pseudo-religious and political activities with the intent of proving that the aim of the higher grades of these varied mysteries and cults is to awaken the serpent, the sex-force or God within. Contents: Sabeism. Eleusis and Mithras; Cabalists, Gnostics, and Secret Syrian Sects; Rosicrucians and Illumines; Weishaupt_s Illuminati and the French Revolution; Carbonari, Mazzini, l_Alliance-israelite-universelle and Karl Marx; The Jewish Question; Continental Freemasonry; Theosophy and India. Co-masonry; Rudolf Steiner and Anthroposophy; Fraternity of Inner Light and Yoga; Aleister Crowley and the Golden Dawn; American Groups; Secret Societies in America, Tibet and China; and The Synarchy of Agarttha.

Title: The Trail of the Serpent
Author: Inquire Within
Publisher: Boswell Publishing
Year: 1936
Format: PDF

